                    subTitle: 'Website where students can code Internet of Things devices and share them with the world.',
                    roles: 'UI Design',
                    imgSrc: './assets/LEAF.png',
                    path: '/leaf',
                    selected: false
                },
                {
                    id: 3,
                    title: 'Internet of Things Playground',
                    subTitle: 'Website where students can code Internet of Things devices and share them with the world.',
                    roles: 'UI Design',
                    imgSrc: './assets/LEAF.png',
                    path: '/leaf',
                    selected: false
                }
            ]
        }
    }

    render() {
        return(
            <p>Grid works</p>
        )
    }
}

export default Grid;
